import React from 'react';
import styled from 'styled-components'

function App() {

  const Button = styled.a`
  display: inline-block;
  border-radius: 3px;
  padding: 0.5rem 0;
  margin: 0.5rem 1rem;
  width: 11rem;
  background: transparent;
  color: white;
  border: 2px solid white;
`;

  return (
    <div>
        <Button> TEST </Button>
    </div>
  )
}

export default App;
